package com.mainshi.proxy;public class StaticProxy implements Developer{    private Developer targetObject;    public StaticProxy(Developer targetObject) {        this.targetObject = targetObject;    }    @Override    public void code() {        System.out.println("静态代理开始");        targetObject.code();        System.out.println("静态代理结束");    }    @Override    public void debug() {        System.out.println("静态代理开始");        targetObject.debug();        System.out.println("静态代理结束");    }}